INSERT INTO `products` VALUES (1,'Alphonse Mangoes - Pack of 4','Alphonso Mango is premium quality mango in terms of sweetness, richness and flavor. It is famous for its unique fragrance and mouth-watering taste. It is a rich source of Vit A, B, C and traces of Vit E &K.',69,100,20.2,1,NULL,'30 minutes',,NULL,1,1),(2,'Symphony Select Assam Tea ','Tea City presents Symphony, a premium assortment of original brews and flavors that relax and revive you instantly. Available in three variants- Assam Tea, Green Tea and Darjeeling Tea.\r\nA perfect combination of premium ctc tea & long orthodex leaves. The preferred choice of consumers who appreciate aroma as much as strength and taste.',99,200,15,0.5,NULL,'1 hour',,'null',2,1),(3,'Twinings Classics English Breakfast Tea - 25 bags','It\'s a tea with a lot of body and a light finish.\r\nTwinings English Breakfast Tea was originally blended to complement the traditional, hearty English breakfast, from which its name derives. Their refreshing and invigorating flavor makes English breakfast one of the most popular black teas to drink at any time or occasion - not just for breakfast. English breakfast can be enjoyed with or without milk, sweetened or unsweetened - the choice is yours. English breakfast tea is a rich and satisfying robust tea, traditionally blended with Kenyan and Assam black teas.\r\nWhere does it come from',150,250,10,0.45,NULL,'45 minutes',,'null',2,1),(4,'Cookies and Cream - London Dairy','London Dairy brings you a elegant combination of vanilla ice cream blended with cookies for the ultimate dessert experience. It is perfect for all chocolate lovers.',90,350,15,NULL,0.5,'25 minutes',,NULL,4,1),(5,'Strawberry Punnet','Fresh or frozen, strawberries are incredibly versatile and delightful',70,130,10,1,NULL,'25 minutes',,NULL,1,1),(6,'Litchi Longan ','Closely allied to the lychee, the longan contains rich amounts of Vitamin C',70,230,5,0.25,NULL,'30 minutes.',,NULL,1,1),(7,'Pepsi Cans - Pack of 6','Refreshing cola drink with zero sugar\r\nHas a bold robust taste with great fizz\r\nFlavorful soft drink perfect to enjoy with delectable snacks\r\nUltimate thirst quencher',100,300,8,NULL,0.25,'1 hour 10 minutes',,NULL,2,1),(8,'Grapes Red Globe','Red Globe grapes are mildly sweet and flavourful. They are not as tangy as Flame seedless ',70,150,22,0.3,NULL,'3 hours',,NULL,1,1),(9,'Maggi Masala Noodles','Favourite instant noodles with goodness of Iron\r\nProvides 15% of your daily Iron requirement\r\nDelicious MAGGI noodles, easy and quick to cook\r\nContains 1 noodle cake and a special masala tastemaker',250,70,30,0.28,NULL,'1 hour',,NULL,3,1),(10,'Bambino Pep Elbows Macaroni','Made of hard wheat\r\nContains dietary fibre\r\nHelps maintain weight',90,80,18,0.35,NULL,'25 minutes',,NULL,3,1),(11,'Maggi Masala Penne Pasta - Pack of 2','Delicious and wholesome, Maggi Masala Penne Pasta is loaded with the goodness of spicy masala mix. Easy to cook and packed with nutrition, this delightful pasta is perfect for those hunger pangs.',98,55,0,0.35,NULL,'25 minutes',,NULL,3,1);
INSERT INTO `products` VALUES (12,'Valencia Orange','Valencia Orange is a small to medium sized fruit having an excellent taste along with numerous seeds. It brings various health benefits because of the vitamin C content.',50,150,7,0.5,NULL,'30 minutes',,NULL,1,1),(13,'Muskmelon','Soft and pulpy, Muskmelon has a soft consistency with a juicy texture. With thin pale green coloured skin and cluster of tiny seeds in the center, this succulent sweet tasting fruit can be used in making various shakes, salads and deserts.',80,250,8,0.85,NULL,'40 minutes',,NULL,1,1);
